[0001 - Generic v2000]
event_type=event
regexp="(\S+\s+\d+\s+\d+:\d+:\d+).(\d+\.\d+\.\d+\.\d+).*?(?:\#|\%)\S+\-\d+\-(?P<sid>\S+)\:.(.*)"
date={normalize_date($1)}
device={$2}
src_ip={resolv($2)}
plugin_sid={translate($sid)}
userdata1={$4}

[0002 - Assoc status v2500]
event_type=event
precheck="STA"
regexp="(\S+\s+\d+\s+\d+:\d+:\d+).(?P<device>\d+\.\d+\.\d+\.\d+).*?STA\s+(?P<sta>\S+).*?(?P<status>deauthed from|associated with|disassociated from)\s+BSSID\s+(?P<bssid>\S+)(?P<reason>.*)"
