device={$device}
src_ip={resolv($device)}
plugin_sid={translate($status)}
userdata1={$sta}
userdata2={$bssid}
userdata3={$reason}

[0003 - Assoc req v2500]
event_type=event
precheck="Assoc request"
regexp="(\S+\s+\d+\s+\d+:\d+:\d+).(?P<device>\d+\.\d+\.\d+\.\d+).*?(?P<bssid>\S+)\s+BSSID\s+(?P<ssid>\S+)\s+SSID.*"
