device={$device}
src_ip={resolv($device)}
plugin_sid=2652
userdata1={$bssid}
userdata2={$ssid}

[0004 - Auth v2500]
event_type=event
regexp="(\S+\s+\d+\s+\d+:\d+:\d+).(?P<device>\d+\.\d+\.\d+\.\d+).*?(?P<sta1>\w{1,2}:\w{1,2}:\w{1,2}:\w{1,2}:\w{1,2}:\w{1,2}).*?(?P<sid>deauthenticated|detected on channel|not found|not authenticated|key exchange completed|successfully authenticated|authentication failure)(?P<userdata>.*)"
date={normalize_date($1)}
device={$device}
src_ip={resolv($device)}
plugin_sid={translate($sid)}
userdata1={$sta1}
userdata2={$userdata}
 
